pragma solidity ^0.8.15;
// SPDX-License-Identifier: MIT

import "./erc721.sol";

contract db is ERC721 {

    address public owner;

    struct Request{
        uint8 number; //number of people needed to be included
        string general; //general health type data: "general", "optometrist", "gut health", etc.
        string fields; //comma delineated string of fields needed from general type of health data: "age, weight, ethnicity", etc.
        string constraints; //in order of fields, will contain the values they must be to be included in the request
        uint8 payment; // amount that request sender will pay to those who provide data (will be uniformly split)
    }

    Request[] public reqList;
    mapping (uint8 => address) public idToOwner;
    mapping (address => uint) public ownerContractCount;


    event NewReq(uint8 number, string general, string fields, string constraints, uint8 id);
    event completedReq(uint8 number, string general, string fields, string constraints, uint8 id);

    constructor() {
        owner = msg.sender;
    }

    function balanceOf(address _owner) external view returns (uint256) {
        return ownerContractCount[_owner];
    }

    function ownerOf(uint256 _tokenId) external view returns (address) {
        return idToOwner[uint8(_tokenId)];
    }

    function transferFrom(address _from, address _to, uint256 _tokenId) external payable {
        uint test;
    }

    function safeTransferFrom(address _from, address _to, uint256 _tokenId) external payable {}

    function approve(address _approved, uint256 _tokenId) external payable {
        uint test;
    }

    function setApprovalForAll(address _operator, bool _approved) external {
        uint test;
    }

    function getApproved(uint256 _tokenId) external view returns (address) {
        return owner;
    }

    function isApprovedForAll(address _owner, address _operator) external view returns (bool) {
        return false;
    }

    function order(uint8 _number, string memory _general, string memory _fields, string memory _constraints, uint8 _payment) public {
        //handles creating a new request, adding to reqlist and gives it an id for mapping
        reqList.push(Request(_number, _general, _fields, _constraints, _payment));
        uint8 id = uint8(reqList.length - 1);
        idToOwner[id] = msg.sender;
        ownerContractCount[msg.sender]++;

        emit NewReq(_number, _general, _fields, _constraints, id);

    }

    function completeOrder(uint8 _id) public {
        //make this only owner eventually
        //require(msg.sender == idToOwner[id], "Sorry, not owner of request");
        Request memory curr = reqList[_id];
        uint8 number = curr.number;
        string memory general = curr.general;
        string memory fields = curr.fields;
        string memory constraints = curr.constraints;
        uint8 payment = curr.payment;

        delete idToOwner[_id]; // delete just switches that id to "0", so id's of other requests should still be the same
        delete reqList[_id]; 
        emit completedReq(number, general, fields, constraints, _id);
    }

    function returnAllOrders() public view returns (Request[] memory) {
        return reqList;
    }

    function out() pure public returns (string memory) {
        string memory message = "Hello World";
        return message;
    }

    function kill(address payable _to) public {
        selfdestruct(_to);
     }     
}
